import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Home from './components/Home';


function App() {
  return (
    <>
      <Routes>
        <BrowserRouter>      <Header /></BrowserRouter>

        <Route path="/" element={<Home />} />
      </Routes>
    </>
  );
}
export default App
